class Solution(object):
    """
    438. Find All Anagrams in a String
    Medium

    3941

    198

    Add to List

    Share
    Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.

    Strings consists of lowercase English letters only and
    the length of both strings s and p will not be larger than 20,100.

    The order of output does not matter.

    Example 1:

    Input:
    s: "cbaebabacd" p: "abc"

    Output:
    [0, 6]

    Explanation:
    The substring with start index = 0 is "cba", which is an anagram of "abc".
    The substring with start index = 6 is "bac", which is an anagram of "abc".
    Example 2:

    Input:
    s: "abab" p: "ab"

    Output:
    [0, 1, 2]

    Explanation:
    The substring with start index = 0 is "ab", which is an anagram of "ab".
    The substring with start index = 1 is "ba", which is an anagram of "ab".
    The substring with start index = 2 is "ab", which is an anagram of "ab".
    Accepted
    340,510
    Submissions
    756,908
    """
    def findAnagrams(self, s, p):
        """
        Runtime: 312 ms, faster than 8.30% of Python online submissions for Find All Anagrams in a String.
        Memory Usage: 14.1 MB, less than 89.93% of Python online submissions for Find All Anagrams in a String.

        :type s: str
        :type p: str
        :rtype: List[int]
        """
        len_s = len(s)
        if(len_s < 1):
            return []
        len_p = len(p)
        if(len_s < len_p):
            return []
        charset_p = {}
        charset_s = {}
        rst_list = []
        for i in xrange(0, len_p):
            charset_p[p[i]] = charset_p.get(p[i], 0) + 1
            charset_s[s[i]] = charset_s.get(s[i], 0) + 1
        if(self.same_charset(charset_s, charset_p)):
            rst_list.append(0)

        for idx in xrange(len_p, len_s):
            s_start = s[idx - len_p]
            s_new = s[idx]
            s_start_count = charset_s[s_start] - 1
            if( 0 == s_start_count):
                charset_s.pop(s_start)
            else:
                charset_s[s_start] = s_start_count
            charset_s[s_new] = charset_s.get(s_new, 0) + 1
            if(self.same_charset(charset_s, charset_p)):
                rst_list.append(idx - len_p + 1)
        return rst_list

    def same_charset(self, _charset_a, _charset_b):
        keys_a = _charset_a.keys()
        keys_b = _charset_b.keys()
        if(len(keys_a) != len(keys_b)):
            return False
        for (elem, value) in _charset_a.items():
            value_b = _charset_b.get(elem, -1)
            if(value_b != value):
                return False
        return True

    def self_testing(self):
        # 0,6
        print(self.findAnagrams("cbaebabacd", "abc"))
        # 0,1,2
        print(self.findAnagrams("abab", "ab"))
        # []
        print(self.findAnagrams("aa", "bb"))
        print(self.findAnagrams("",
                                ""))

Solution().self_testing()
